    "title": "Introduction",
    "category": "section",
    "text": "This package contains Julia versions of the mcmc models contained in the R package \"rethinking\" associated with the book Statistical Rethinking by Richard McElreath. It is part of the StatisticalRethinkingJulia Github organization of packages.This package implements the models using DynamicHMC."
